app.get('/hotels/new',function(req,res){
	res.render('new.ejs')
});


app.get('/hotels',function(req,res)
{
	res.render('rooms',{rooms: rooms });
});

app.post('/hotels',function(req,res){
	var name = req.body.name;
	var image = req.body.image;
	var newHotel = {
		name : name,
		image : image
	}
	rooms.push(newHotel);
	res.redirect('/hotels')
});